import React from "react";
import avatarDefault from "../../../../../component/Layout/assets/avatar-user.png";
import Avatar from "@mui/material/Avatar";
import { grey } from "@mui/material/colors";

export default function FriendListItem({ friend, OnClickContactBtn }) {
  const avatarStyles = {
    m: 1,
    border: 2,
    borderColor: "#808080",
  };

  return (
    <>
      <li className="FriendListItem" onClick={OnClickContactBtn}>
        <div>
          <Avatar
            src={friend.picture || avatarDefault}
            alt={friend.username}
            sx={{
              ...avatarStyles,
            }}
          />
          <div className="UserListItemName">{friend.username}</div>
        </div>
      </li>
    </>
  );
}
